import React from 'react'
import './style.css'
export class index extends React.Component {
	render() {
		return (
			<div className="container">
				<table>
					<tr>
						<th>Products</th>
						<th>Details</th>
						<th>Price</th>
						<th>Quantity</th>
						<th>Action</th>
					</tr>
				</table>
			</div>
		)
	}
}

export default index
